import { useEffect } from "react";
import Project from "./Project";

const Projects = ({ section }) => {

  useEffect(() => {
    section.projets.forEach((_, index) => {
      console.log("Projet affiché à l'écran - Index:", index);
    });
  }, [section.projets]);

  return (
    <div className="projects" id="projects">
      <div className="projects-summary">
        <span></span>
        <div>
          {section.projets.map((projet, index) => (
            <p key={index}>{projet.titre_projet}</p>
          ))}
        </div>
      </div>
      <div className="projects-list">
        {section.projets.map((project, index) => {
          console.log("Projet affiché à l'écran - Index:", index);
          return <Project key={index} project={project} titreSection={section.titre} />;
        })}
      </div>
    </div>
  );
};

export default Projects;
